#include <bits/stdc++.h>
using namespace std;
namespace Slongod{
const int N = 3e5+7;
int n , a[N] , p[N];
bool check(int x)
{
    for (int i = 1; i <= 2*n-1; i++) {
        p[i] = (a[i] >= x ? 1 : 0);
    }
    for (int i = 0; i < n-1; i++) {
