    while(l <= r) {
        int mid = (r - l) / 2 + l;
        if (!check(mid)) {
            r = mid - 1;
        } else {
            l = mid + 1;
            ans = mid;
        }
    } cout << ans << '\n';
    return 0;
}
}int main()
{
    ios :: sync_with_stdio(0);
    cin.tie(0) , cout.tie(0);
    return Slongod :: main();
}
